import './App.css';
import React from 'react';
import styles from './App.css';
function App() {
  return (
    <div className='App'>
        <div className="header">
            <div className="header-left">
                <h1>E-Wardrobe</h1>
            </div>
            <div className="header-right">
                <a className="active" href="#home">Home</a>
                <a href="#contact">Contact</a>
                <a href="#about">About</a>
            </div>
            <div className="parent">
                <div className="header"><img src={require("./clothes/tshirt1.jpeg")} /></div>
                <div className="mannequin"><img src={require("./clothes/tshirt2.jpeg")} /></div>
                <div className="leftside"></div>
                <div className="rightside"></div>
            </div>
        </div>


        <button onClick={addItem}>Add a clothe</button>
    </div>
  );
}

function addItem(){
    alert("Do you really want to add a clothe in your  E-Wardrobe ?")
}
export default App;
